import React from "react";
import './App.css';
import NavigationBar from "./NavigationBar/NavigationBar";

function App() {
  return (
    <div className="App">
      <NavigationBar />
      <h1> Платформа для поиска стажировок и работы для студента
      </h1>
      <h2>
        Начни свой профессиональный путь, чтобы расти 
      </h2>
    </div>
  );
}

export default App;
